	var uStates={};
	
	uStates.draw = function(id, data, toolTip){		
		function mouseOver(d){
			d3.select("#tooltip").transition().duration(200).style("opacity", .9);      
			//alert(d);
			d3.select("#tooltip").html(toolTip(d.n, data[d.id]))  
				.style("left", (d3.event.pageX) + "px")     
				.style("top", (d3.event.pageY - 28) + "px");
		}
		
		function mouseOut(){
			d3.select("#tooltip").transition().duration(500).style("opacity", 0);      
		}
		
		function onClick(d){
			if(data[d.id].projects > 0)
			{
				window.open("view/"+d.id);
			}
		}
				
		var mapSVGObject = d3.select(id).selectAll(".state")
			.data(uStatePaths).enter();
			var pathObject = mapSVGObject.append("path").attr("class","state").attr("d",function(d){ return d.d;}).attr("id", function(d){ return d.id;});
			pathObject.style("fill",function(d){ return data[d.id].color; })
			.on("mouseover", mouseOver).on("mouseout", mouseOut).on("mousedown", onClick);
		
		//mapSVGObject.append("Text").text(function (d,i){ return d.id;});
		
	}
	this.uStates=uStates;
var i =0;
function addText(p)
{
    var t = document.createElementNS("http://www.w3.org/2000/svg", "text");
    var b = p.getBBox();
    t.setAttribute("transform", "translate(" + (b.x*10 + b.width/2) + " " + (b.y*10 + b.height/2) + ")");
    t.textContent = uStatePaths[i].id;
	i = i+1;
    t.setAttribute("fill", "black");
    t.setAttribute("font-size", "14");
    p.parentNode.insertBefore(t, p.nextSibling);
}

